import React, { Fragment } from 'react'
import './header.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';

const Header = ({ isAthenticated }) => {
    const value = isAthenticated
        ? (
            <Fragment>
                <li className="header-auth-list__element">
                    <Link to="/register">Регистрация</Link>
                </li>
                <li className="header-auth-list__element">
                    <Link to="/login">Войти</Link>
                </li>
            </Fragment>
        ) : (
            <li className="header-auth-list__element">
                <Link to="/login">Войти</Link>
            </li>
        )
    return (
        <header className="header">
            <h1 className="header__element header__element--heading">
                <i className="fa fa-address-book" aria-hidden="true"></i>
                Книга контактов
            </h1>
            <ul className="header__element header-auth-list">


            </ul>
        </header>
    )
}

const mapStateToProps = state => ({
    isAthenticated: state.auth.isAthenticated
})

export default connect(mapStateToProps)(Header)
